Putting everything together, we now have our second hello world program that is made of a hello_provider and a hello_client communicating with each others. use ferrite_session::prelude::*; type Hello = SendValue<String, End>; #[tokio::main]
async fn main()
{ let hello_provider: Session<Hello> = send_value("Hello World!".to_string(), terminate()); let hello_client: Session<ReceiveChannel<Hello, End>> = receive_channel(|a| { receive_value_from(a, move |greeting| { println!("Received greetings from provider: {}", greeting); wait(a, terminate()) }) }); let main: Session<End> = apply_channel(hello_client, hello_provider); run_session(main).await; }
